import React from 'react';
import {useState, useEffect} from 'react';
import Api from './Api'

const Simulation = () => {
    const [elevators, setElevators] = useState([])

    const getElevatorsFromDb = () => {
        Api.get("api/v1/elevators"
             ).then(res => {
                 setElevators(res.data)
        }).catch(e => {
            console.log(e)
        })
    }

    useEffect(() => {
        getElevatorsFromDb()
    })

    return (
        <div>

        </div>
    );
};

export default Simulation;
